const UseDeferredValueExample = () => {
    const [text, setText] = useState("");
    const deferredText = useDeferredValue(text);

    const defList = useMemo(() => {
        return data.filter((el: any) => el.name.includes(deferredText));
    }, [deferredText]);

    const list = useMemo(() => {
        return data.filter((el: any) => el.name.includes(text));
    }, [text]);

    const isStall = deferredText !== text;

    return (
        <div>
            <label>
                Search:
                <input
                    value={text}
                    className="text-indigo-800"
                    onChange={(e) => {
                        setText(e.target.value);
                    }}
                />
            </label>

            <div className="flex h-60 overflow-scroll">
                <div className="mr-16">
                    <Suspense fallback={<h2>Loading....</h2>}>
                        <ul className={isStall ? "opacity-50" : "opacity-100"}>
                            <li className="text-xl my-2">
                                List by using deferredValue
                            </li>
                            {text !== "" &&
                                defList.map((el) => (
                                    <li key={el._id}>{el.name}</li>
                                ))}
                        </ul>
                    </Suspense>
                </div>
                <Suspense fallback={<h2>Loading....</h2>}>
                    <ul className={isStall ? "opacity-50" : "opacity-100"}>
                        <li className="text-xl my-2">
                            List by using actual state
                        </li>
                        {text !== "" &&
                            list.map((el) => <li key={el._id}>{el.name}</li>)}
                    </ul>
                </Suspense>
            </div>
        </div>
    );
};

export default UseDeferredValueExample;
